// import React from 'react'
const Products = [
    {
        id: 1,
        title: 'book1'
    },
    {
        id: 2,
        title: 'book2'
    },
    {
        id: 3,
        title: 'book3'
    }
]


const ProductList = () => {
  return (
    <div>
      {Products.map((item)=>{
        return <h2>{item.title}</h2>
      })}
    </div>
  )
}

export default ProductList
